INSERT INTO `products` VALUES (1,'Xe Cũ BMW 5 520i 2014','xe-cu-bmw-5-520i-2014',' Xe được sử dụng với mục đích gia đình, được chăm sóc cẩn thận. BMW 520i sử dụng động cơ Twin Turbo 4 xi-lanh thẳng hàng dung tích 2.0L, công suất 184 mã lực tại vòng tua máy 5.000 vòng/phút. Tốc độ tối đa 226 km/h sau khi tăng tốc từ 0 lên 100 km/h trong vòng 8 giây. Tiêu hao nhiên liệu trung bình là 7.6L/100 km. Hộp số tự động 8 cấp, túi khí quanh xe, có 3 chế độ vận hành, hệ thống phanh tay điện tử, vô lăng chỉnh điện, điều hòa 2 vùng độc lập, hệ thống tự động ngắt động cơ, tái sinh năng lượng khi giảm tốc cùng trang bị lốp an toàn và rất nhiều công nghệ khác.. Không gian nội thất được bọc da cao cấp, nhiều chi tiết làm từ kim loại hoặc ốp gỗ sang trọng. Trung tâm bảng điều khiển là màn hình giải trí cỡ vừa tích hợp Camera lùi, bản đồ Việt Nam, kết nối điện thoại rảnh tay, AM, FM, CD, AUX, USB,… Phía dưới còn có một màn hình LCD cỡ nhỏ hiển thị thông số nhiệt độ. Vô-lăng là loại 3 chấu bọc da tích hợp một số phím chức năng xử lý nhanh hỗ trợ người lái. ',1,1,1420,'2018-05-16 09:43:19','2018-05-16 09:43:19'),(2,'Xe Mới Chevrolet Spark MT 2018','xe-moi-chevrolet-spark-mt-2018',' ? CHỈ CẦN TRẢ TRƯỚC 45 TRIỆU, MỖI THÁNG TRẢ 4 TRIỆU NHẬN NGAY SPARK MỚI 2018?  ?Khuyến mại CỰC SỐC giảm 32 triệu xe Spark trong tháng 05 chào đón hè 2018 ? Hỗ trợ đăng ký , nộp thuế, đăng kiểm, giao xe tận nhà( Miễn phí) ? Bán trả góp tất các tỉnh thành miền bắc, xử lý mọi hồ sơ khó ? Đủ các màu xe giao ngay, tư vấn tận tình, chuyên nghiệp ****THỜI ĐIỂM MUA XE RẺ TRONG NĂM ***** - Chevrolet Spark 2018, sự lựa chọn số 1 cho chiếc xe gia đình. - Xe thương hiệu Mỹ, đầm chắc phân khúc, hiện nay. - Động cơ mạnh mẽ, CỰC KỲ tiết kiệm nhiên liệu 4,5 lít/100km -Tay lái trợ lực điện, 2 túi khí - Khung vỏ dày , chạy cực đầm chắc, có xe lái thử - Xử lý mọi hồ sơ ngân hàng, chỉ cần CMT, Hộ khẩu, Đăng ký kết hôn. ::::::::::::::::::::::::::::::::::::::::::::::::::::: Chính sách hậu mãi ⭐️  ✅ Bảo hành 3 năm / 100.000km trên toàn hệ thống. ✅ Tặng thẻ VIP cứu hộ miễn phí Toàn Quốc trong 3 năm. ✅ Liên kết với các đơn vị bảo hiểm Uy Tín hàng đầu. Sữa chữa trong thời gian ngắn .  ✅ Chi phí bảo hành bảo dưỡng thấp, chất lượng phục vụ cao. ?Showroom Chevrolet Newway 183 Yên Lãng, Đống Đa, HN. ',1,1,268,'2018-05-16 09:43:19','2018-05-16 09:43:19'),(3,'Xe Mới Lexus RX 350 2017','xe-moi-lexus-rx-350-2017',' Kích thước ( D x R x C ) ( mm ) 4.890 x 1.885 x 1.696 Khoảng cách giữa 2 láp (mm) 2.740 Tự trọng(Kg ) 1.970 Khoảng sang gầm xe ( mm) 185 Dung tích xi lanh ( cc ) 3.5L Kiểu động cơ V6 DOHC Dual VVTi Hộp số Tự Động 8 cấp, truyền động điện tử có kiểm soát (ECT) Công suất (hp @ vòng / phút) 295hp @ 6200 rpm Momen xoắn (lb.ft @ vòng / phút) 268 lb.ft @ 4700 rpm Bình nhiên liệu ( l ) 72,5L Loại nhiên liệu Xăng Kiểu dẫn động 2 Cầu AWD Số cửa/chỗ ngồi 05/05 Cỡ lốp 235/55 R20 II. TRANG THIẾT BỊ AN TOÀN & TIỆN NGHI Hệ thống túi khí an toàn: 10 túi khí Phím điều khiển tích hợp vô lăng Hệ thống chống bó cứng phanh ABS Kính màu chống tia cực tím, 1 chạm chống kẹt Hệ thống kiểm soát phanh điện tử ECB Gương gập điện auto, gương chiếu hậu chống chói ECM Hệ thống phân bổ lực phanh điện tử EBD Hàng ghế trước điều chỉnh điện 10 hướng, nhớ ghế lái Hệ thống cân bằng điện tử VSC Hệ thống âm thanh cao cấp 15 loa 835Watt Mark Levison Hệ thống chống trơn trượt Traction control Màn hình DVD trung tâm hiển thị đa chức năng tích hợp camera lùi Hệ thống cảnh báo va chạm PRE Kết nối bluetooth _ AUX_USB, Radio FM-AM Hệ thống cảnh báo vượt, chệch làn đường DVD tích hợp tựa đầu hàng ghế trước Hệ thống đi ga tay Cruise control Nội thất da cao cấp, ốp vân gỗ Ebony Hệ thống cảm biến áp suất lốp TMPS Sấy và thông gió hàng ghế trước Hệ thống khóa Smart key, Start/Stop Điều hòa tự động 2 vùng, lọc gió không khí Hệ thống khởi động bằng điện thoại Enform Remote Đèn pha Led Taillamps Vô lăng điều khiển điện 4 hướng ,trợ lực lái EPS Cảm biến xung quanh xe với camera lùi toàn cảnh Cửa nóc điều k