',' ???Mercedes C250AMG Sx 2015  ?C250AMG màu trắng nội thất đỏ ?Sản xuât 2015 đã sử dụng 27.000km ?Loa Bumester, cửa nóc, body AMG... ?Xe cực đẹp và mới  ?Cam kết không lỗi, không ngập, không đâm đụng .... ?Hỗ trợ ngân hàng 70% ?Giá bán: 1,4xx tỷ VNĐ  ?: 0946.287.666 ☎️: 0971.612.612 ',1,1,1440,'2018-05-16 09:43:24','2018-05-16 09:43:24'),(8,'Xe Cũ KIA Cerato 1.6AT 2009','xe-cu-kia-cerato-1-6at-2009',' Salon ô tô Ánh Lý bán Kia Cerato 1.6L AT sản xuất 2009 nhập khẩu nguyên chiếc, biển tỉnh hồ sơ rút ngay trong ngày. Trang bị option theo xe: Khởi động nút ấn Start/ Stop thông minh, 6 loa kết nối AUX, USB, ipod, Bluetooth, gương chiếu hậu chống chói, gương chỉnh điện gập điện, xi nhan tích hợp trên gương, cửa sổ trời, 03 chế độ lái ECO tiết kiệm nhiên liệu, Cảm biến tiến lùi, camera lùi, nội thất da cao cấp... Quý khách quan tâm liên hệ trực tiếp để có thông tin tốt nhất. ',1,1,375,'2018-05-16 09:43:25','2018-05-16 09:43:25'),(9,'Xe Mới Hyundai Tucson 2.0 CRD-i 2017','xe-moi-hyundai-tucson-2-0-crd-i-2017',' Khi điện thoại đến số HOTLINE, Quý khách hàng vui lòng nhắc tới Choxe.net để nhận được hỗ trợ tốt nhất.  [GIÁ CẢ] Giá bán đã trừ khuyến mại của tập đoàn. Để nhận tư vấn cụ thể hơn, liên hệ Hotline  [KHUYẾN MẠI] Khuyến mại bộ phụ kiện 5 triệu (Chính sách sẽ thay đổi theo thời điểm, vui lòng liên hệ ngay Hotline để nhận thông báo mới nhất).  [CHO VAY] Hỗ trợ vay vốn tối đa 100% (nếu thế chấp tài sản khác) hoặc tối đa 90% giá trị xe (nếu thế chấp xe), vay tối đa 7 năm, lãi suất từ 5.9%/năm. Để nhận tư vấn cụ thể hơn, liên hệ Hotline   [GIỚI THIỆU] Hyundai Tucson \"ăn\" gần 4,5L dầu cho 100km đường trường* Động cơ dầu luôn luôn là điểm mạnh của Hyundai, đã chiếm được lòng tin tưởng của người tiêu dùng bởi sự bền bỉ, mạnh mẽ nhưng tiết kiệm nhiên liệu và ít tạo ra tiếng ồn vọng vào khoang lái. Chính điều này đã tạo nên nỗi hụt hẫng cho các khách hàng Việt Nam khi bản nhập khẩu trước đó chỉ có duy nhất một tuỳ chọn động cơ xăng Nu 2.0. Cho đến khi phiên bản lắp ráp CKD ra mắt cuối tháng 8/2017 vừa rồi. Như một làn nước mát giải khát cho tập khách hàng yêu thích máy dầu của Hyundai và đang tìm kiếm một chiếc xe 5 chỗ gầm cao, Hyundai Tucson CKD 2017 ngay lập tức tạo nên cơn sốt tại Việt Nam. Động cơ dầu R 2.0 CRDi ứng dụng công nghệ van biến thiên điều khiển điện tử eVGT cho công suất tối đa 185 mã lực tại 4.000 vòng/phút cùng Momen xoắn cực đại 4.000 Nm tại 1.750~2.750 vòng/phút. Với khối sức mạnh thừa thãi này, Hyundai Tucson chỉ tiêu tốn chưa đến 4.5L cho 100 km đường trường. Kể từ cuối tháng 8/2017, tại Việt Nam, Hyundai Tucson được phân phối dưới dạng CKD (Lắp ráp trong nước) thay vì CBU (nhập khẩu nguyên chiếc) như trước. Xin lưu ý rằng, dây chuyền lắp ráp được Hyundai Thành Công áp dụng là dây chuyền hiện đại nhất hiện nay mà Hyundai Toàn Cầu đang sử dụng. Theo đó, ở công đoạn cuối, từng chiếc xe chuẩn bị xuất xưởng tại Việt Nam đều được truyền dữ liệu trực tiếp sang Hyundai Hàn Quốc, qua kiểm duyệt trước khi được xuất xưởng và phân phối ra thị trường. Do đó, chất lượng của các xe Tucson ở Việt Nam hoàn toàn tương đồng với các thị trường khác của Hyundai. Hyundai Tucson CKD 2017 máy Dầu 2.0 có kích thước dài x rộng x cao lần lượt là 4475 x 1850 x 1660 (mm). Chiều dài cơ sở là 2670 mm, khoảng sáng gầm xe 172 mm. Dung tích bình nhiên liệu đạt 62L. Ở phiên bản lắp ráp CKD, Hyundai Tucson được ra mắt thêm 2 tuỳ chọn động cơ mới bên cạnh động cơ xăng Nu 2.0 MPI (155Ps tại 6.200 vòng/phút) như trước: 1. Động cơ dầu R 2.0 CRD-i tiết kiệm (185 Ps tại 4.000 vòng/phút). 2. Động cơ xăng 1.6 T-GDI Turbo mạnh mẽ (177 Ps tại 5.500 vòng/phút).  [TIỆN NGHI] Các trang thiết bị tiện nghi trên Tucson CKD 2017: - Drive mode 3 chế độ (\"Đặc sản của Hyundai\"). - Chìa khoá thông minh (Khởi động Start/stop). - Kính chỉnh điện; kính cửa lái tự động chống kẹt. - Ngăn lạnh phía trước. - Cửa sổ trời toàn cảnh Panorama. - Điều khiển hành trình Cruise Control (trừ bản thường). - Hệ thống chống trộm Immobilizer. - Hệ thống định vị dẫn đường thông minh phát triển riêng cho Việt Nam. - 6 Loa. - Cửa gió hàng ghế sau. - Tấm chẵn khoang hành lý cơ động. - Điều hoà tự động 2 vùng khí hậu độc lập. - Ghế da cao cấp. - Ghế lái chỉnh điện 10 hướng, ghế phụ chỉnh điện 8 hướng (Trừ bản thường). - Ghế sau có khả năng ngả, hoặc gập 6:4.  [AN TOÀN] Các công nghệ an toàn của Tucson CKD 2017 máy Dầu 2.0 bao gồm: - Hệ thống chống bó cứng phanh ABS. - Hệ thống hỗ trợ phanh khẩn cấp BA. - Hệ thống phân bổ lực phanh EBD. - Hệ thống kiếm soát lực kéo TCS. - Hệ thống ổn định chống trượt thân xe VSM. - Hệ thống cân bằng điện tử ESC. - Hệ thống hỗ trợ khởi hành ngang dốc HAC. - Hệ thống hỗ trợ xuống dốc DBC. - Phanh tay điện tử EPB. - Khung xe thép cường lực AHSS. - Cốp điện thông minh chống kẹt (Tự động đóng mở). - Giảm xóc hiệu suất cao ASD (Chỉ trang bị trên bản 1.6 Turbo). - 6 túi khí an toàn. ',1,1,940,'2018-05-16 09:43:26','2018-05-16 09:43:26'),(10,'Xe Mới Ford Ranger XLS AT 2018','xe-moi-ford-ranger-xls-at-2018',' ? XE BÁN TẢI FORD RANGER XLS 4x2 AT KHUYẾN MÃI LỚN NHẤT TẠI FORD HÀ NỘI? ╔═══════════════════╗ GIÁ TỐT NHẤT TOÀN QUỐC  ╚═══════════════════╝ *Bảo hành chính hãng 3 năm toàn quốc. *Hỗ trợ đăng ký, đăng kiểm giao xe tận nhà. *Trả góp lãi xuất thấp nhất. *** TÍNH NĂNG VÀ TIỆN NGHI*** ? Động cơ Diezel 2.2L Turbo tăng áp tiêu thụ nhiên liệu trung bình 7 lít/100Km. ? Hộp số tự động 6 cấp tăng tốc êm ái và tiết kiệm. ? Điều khiển hành trình/ga tự động Cruise Control. ? Điều khiển bằng giọng nói Voice Control các thiết bị giải trí và tiện nghi. ? Kết nối điện thoại, đồng bộ danh bạ hoặc các thiết bị điện tử giúp nghe nhạc hoặc gọi điện thoại rảnh tay khi đang lái xe. ? Gương kính điện, chìa khoá điều khiển và chống trộm. ⚠ Hệ thống cân bằng điện tử ESP an toàn được trang bị duy nhất trong phân khúc. ⚠ An toàn với 2 túi khí kép SRS. ⚠ Dây đai an toàn 3 điểm với giới hạn lực siết theo va chạm. ⚠Chống bó cứng phanh ABS. ⚠Phân phối lực phanh điện tử EBD. ⚠Trợ lực phanh khẩn cấp BA. ⚠ Vi-sai hạn chế trơn trượt tiên tiến nhất phân khúc