 sắc hơn và giá rẻ hơn.  [NỔI BẬT] GRAND I10 CKD 2017 được nâng cấp 2 điểm khác biệt rất đáng giá: 1. Grand i10 CKD 2017 được trang bị dải đèn LED chạy ban ngày DRL (Daytime Running Light) giúp chiếc xe nổi bật trên phố, thu hút sự chú ý khi xe lăn bánh trên đường. 2. Grand i10 CKD 2017 được bổ sung thêm tính năng phân bổ lực phanh điện tử EBD, kết hợp với hệ thống chống bó cứng phanh ABS giúp cho chiếc xe an toàn hơn mỗi khi sử dụng phanh, không lo phanh thiếu lực hay dư thừa lực phanh, dễ dàng kiểm soát xe mỗi khi xảy ra tình huống bất ngờ.  [NGOẠI THẤT] GRAND I10 1.0 AT CKD 2017 hoàn toàn mới vẫn thừa hưởng thiết kế ngoại thất cá tính và thời trang của ngôn ngữ điêu khắc dòng chảy 2.0 trước đó. Chiếc xe sở hữu kích thước tổng thể dài nhân rộng nhân cao lần lượt là 3765x1660x1505 đối với bản Hatchback 5 cửa, 3995x1660x1505 đối với bản Sedan 4 cửa, cùng với đó là khoảng sáng gầm xe 152mm và chiều dài cơ sở 2425mm đối với cả 2 phiên bản. Các kích cỡ của Grand i10 vượt trội hơn hẳn so với các đối thủ, nội thất rộng rãi bậc nhất đem đến cho khách hàng một chiếc xe đô thị phân khúc A mà trải nghiệm của các dòng xe phân khúc cao hơn. Mẫu xe Grand i10 nâng cấp của năm 2017 được sở hữu đường nét khoẻ khoắn, trẻ trung hơn với cả dưới cùng lưới tản nhiệt cỡ lớn hình lục giác tạo hình thác nước với các nan nhỏ bên trong cũng được tạo hình lục giác giúp tăng cường lượng khí làm mát cho động cơ, gia tăng hiệu suất tối đa, kết hợp với cụm đèn sương mù và dải đèn led chạy ban ngày DRL (Daytime Runing Light) tạo nên phong cách thể thao và ấn tượng ngay từ cái nhìn trực diện. Toàn bộ thân xe được bo tròn phối hợp những đường cắt và đường gân chạy dọc nổi tôn lên tính khí động học và vẻ rộng rãi của xe. Phiên bản Hatchback được trang bị la zăng hợp kim 4 chấu kép 14” dinamon CUT làm tăng thêm tính thể thao. Còn phiên bản Sedan trang bị la zăng hợp kim nhôm 14” với các nan lớn gia tăng vẻ lịch lãm của xe. Gương chiếu hậu của Hyundai GRAND I10 1.0 AT CKD 2017 có thể chỉnh điện, gập điện và được trang bị thêm tính năng sấy gương chưa từng xuất hiện trước đó. Với tính năng mới này, chúng ta sẽ không phải lo lắng khi gương ngoài bị hấp hơi hay đọng hơi nước cản trở tầm quan sát phía sau, gia tăng an toàn và tiện dụng. Ở phía sau, Grand i10 được trang bị cụm đèn hậu cỡ lớn tạo hình vân Led 3D đem đến hiệu quả chiếu sáng đẹp mắt và dễ dàng phát hiện khi phanh ở trong những điều kiện thiếu sáng, gia tăng tính an toàn. Các chi tiết khác thể hiện sự tinh tế trong thiết kế của Grand i10 như tay năm cửa mạ Crom, đèn xi nhan tích hợp trên gương, đèn phanh trên cao dạng LED, ăng ten đuôi chuồn, ốp hông nổi màu đen tạo nên một chiếc xe sở hữu ngoại hình hấp dẫn hàng đầu phân khúc mang phong cách châu âu hiện đại.  [NỘI THẤT] Hyundai GRAND I10 1.0 AT CKD 2017 sở hữu khoang nội thất rộng rãi thoải mái và hiện đại hàng đầu phân khúc nhờ các kích cỡ vượt trội. Phong cách thiết kế nội thất nhấn mạnh đến sự thuận tiện, hợp lý trong việc bố trí các nút chức năng cho người dùng. Hyundai Grand i10 lần đầu tiên ra mắt vào năm 2014 là dòng xe tiên phong trong phân khúc xe hạng A được trang bị tính năng khởi động Start/stops engine một chạm, kết hợp với chìa khoá thông minh Smart Key tiếp tục được kế thừa cho tới phiên bản hiện tại, mang đến tính hiện đại và thuận tiện cho chủ nhân chiếc xe. Bảng trung tâm nổi bật với màn hình cảm ứng 7” đa chức năng, hỗ trợ giải trí với các kết nối thời thượng hiện nay như USB/AUX/Bluetooth, radio… hỗ trợ phát hình đa dạng độ phân giải FullHD cùng với 4 loa chất lượng. Bên cạnh đó Màn hình AVN này được các kỹ sư Hyundai nghiên cứu riêng phần mềm bản đồ dẫn đường chuyên dụng dành riêng cho thị trường Việt Nam, đem đến cho người dùng một ứng dụng chất lượng về thông tin. Nội thất xe được bọc da pha nỉ kết hợp cùng các chi tiết nhựa đen được bố trí hợp lý sử dụng tông màu trẻ trung tạo nên không gian nội thất hiện đại cho chiếc xe. Vô lăng của Grand i10 được bọc da, sử dụng hệ thống trợ lực điện giúp tiết kiệm nhiên liệu, dễ dàng xoay sở trong thành phố đông đúc nhưng vẫn đem đến cảm giác lái chân thật. Trên vô lăng đã được tích hợp các nút điều khiển hệ thống, gia tăng an toàn, tránh việc người lái bị mất tập trung khi cần tương tác với hệ thống. Bên trong Hyundai GRAND I10 1.0 AT CKD 2017 được bố trí nhiều hộc chứa đồ, cùng với hàng ghế sau có thể gập hoàn toàn, giúp cho người dùng tối ưu hoá được không gian ngồi trong xe.  [AN TOÀN] Hyundai GRAND I10 1.0 AT CKD 2017 được trang bị những tính năng an toàn hàng đầu như túi khí đơn, cảm biến lùi hỗ trợ đỗ xe, camera lùi đối với bản sedan, hệ thống chống bó cứng phanh ABS, hệ thống phân bổ lực phanh điện tử EBD. Đặc biệt, grand i10 được trang bị khung xe với vật liệu chịu lực cao giúp hấp thụ tối đa lực tác động khi xảy ra tình huống va chạm, đảm bảo an toàn cho toàn bộ hành khách ngồi trong xe. ',1,1,380,'2018-05-16 09:43:35','2018-05-16 09:43:35'),(20,'Xe Cũ BMW 3 320 LCI 2016','xe-cu-bmw-3-320-lci-2016',' ???BMW 320i full M3  ?BMW 320i sx 2016 đăng ký 2017 ?Màu trắng nội thất đen ?Đã sử dụng 22.000km ?Đèn full led, đá cốp  ?Động cơ mới B48  ?Body kit M3 ?Ốp gương carbon M3  ?Vành BBS made in Germany 19 inch ?Bô Army trix của Mỹ cùng chụp bô Akrapovic  ?Mặt ca lăng kép M3 ?Dán kinh vkool  ?Vô Lăng M3 cực đẹp ?NBT logic 7 mới nhất  ?Loa Harman Kadon  ?Cam hành trình BMW chính hãng ?Xe cực đẹp, full đồ, nổi bật và mang cá tính riêng, cảm giác lái tuyệt vời ?Bô uy lực tăng hp cho sức mạnh như siêu xe  ?Xe cam kết, không lỗi, không đâm, không ngập  ?Ngân hàng hỗ trợ 70% ?Giá bán: 1,439 tỷ VNĐ ?: 0971.612.612 ☎️: 0946.287.666 ',1,1,1439,'2018-05-16 09:43:36','2018-05-16 09:43:36'),(21,'Xe Mới Ford Ranger Wildtrak 3.2 4x4 2018','xe-moi-ford-ranger-wildtrak-3-2-4x4-2018',' ? Xe bán tải Ford Ranger Wildtrak 3.2L đang khuyến mãi lớn nhất toàn quốc tại Ford Hà Nội ? – 0903 230 587 – Website: www.xeford.vn ========================================================== ***KHUYẾN MÃI*** www.xeford.vn ? Tặng quà giá trị theo xe. ? Trả góp lãi xuất thấp nhất toàn quố