:43:37'),(22,'Xe Cũ Mazda 3 1.5AT 2015','xe-cu-mazda-3-1-5at-2015',' Bán Mazda 3 1.5AT 2015 Xe Trang Bị :  -Phanh ABS -Điều hòa tự động hai vùng khí hậu -Cửa sổ trời -Chìa khóa thông minh - Khởi động bằng nút bấm -Gương, kính chỉnh điện, gập điện -Điều khiển tích hợp trên vô lăng -Màn hình giải trí trung tâm -04 Túi khí ',1,1,608,'2018-05-16 09:43:38','2018-05-16 09:43:38'),(23,'Xe Cũ Toyota Vios 1.5MT 2008','xe-cu-toyota-vios-1-5mt-2008',' Salon ô tô Ánh Lý bán Vios E 2009 màu bạc biển tỉnh hồ sơ rút nhanh gọn. Xe đã qua kiểm tra 176 hạng mục chính hãng của Toyota Cam kết không đâm đụng không ngập nước, máy móc nguyên bản của nhà sản xuất. Xe trang bị: Số sàn, máy xăng, dẫn động một cầu. Nội thất bọc da cao cấp sang trọng đầu đĩa DVD kết hợp cảm biến lùi nghe nhac, FM/AM và nhiều tiện ích khác. Hỗ trợ trả góp, thời gian thanh toán lên đến 5 năm với lãi suất hấp dẫn thủ tục nhanh gọn ',1,1,320,'2018-05-16 09:43:41','2018-05-16 09:43:41'),(24,'Xe Mới Hyundai I10 1.2AT HB 2018','xe-moi-hyundai-i10-1-2at-hb-2018',' Hyundai GRAND I10 1.2 AT 2018 chính hãng xe mới, đủ màu giao ngay. Liên Hệ Mr Sơn 0971986000 Để Có giá sốc Kích thước/Trọng lượng Dài x Rộng x Cao 3765x1660x1505 (mm) Chiều dài cơ sở 2425 mm Dung tích bình nhiên liệu 43 (lít) Động cơ Động cơ: KAPPA 1.2 Kiểu động cơ: 1.2 , 4 xi lanh Dung tích xi lanh : 1199 (cc)  Phanh - Giảm xóc - Lốp Phanh đĩa/tang trống Giảm sóc: Macpheron/ thanh xoắn Lốp xe 165/65r14 Vành mâm xe đúc hợp kim  Thiết bị định vị; Kính chỉnh điện; Tay lái trợ lực; Điều hòa trước; Màn hình LCD; Túi khí cho người lái; Chống bó cứng phanh (ABS).... _ Xe có sẳn đủ màu hỗ trợ giao ngay _ Trả Góp lên đến 80% giá trị xe (Thủ Tục Nhanh Gọn) _ Bảo Hành 3 Năm hoặc 100.000Km ',1,1,390,'2018-05-16 09:43:42','2018-05-16 09:43:42'),(25,'Xe Cũ KIA Cerato 1.6MT 2016','xe-cu-kia-cerato-1-6mt-2016',' Bán Kia Cerato 1.6MT 2016 Xe Trang Bị :  -Phanh ABS -Điều hòa tự động hai vùng khí hậu -Cửa gió hàng ghế thứ hai -Gương, kính chỉnh điện, gập điện -Điều khiển tích hợp trên vô lăng -Chìa khóa điều khiển từ xa -Màn hình giải trí trung tâm -02 Túi khí -3 Chế độ vận hành Drive Mode: Eco - Normal - Sport ',1,1,534,'2018-05-16 09:43:43','2018-05-16 09:43:43'),(26,'Xe Mới Land Rover Range Rover Verla 2018','xe-moi-land-rover-range-rover-verla-2018',' Range Rover Velar trang bị tiêu chuẩn hệ thống ổn định thân xe chủ động và hệ thống phân bổ vòng tua khi vào cua. Bên cạnh các công nghệ hỗ trợ hiện đại khác, như kiểm soát địa hình ATPC, hệ thống phù hợp địa hình thế hệ 2, và hệ thống khóa vi sai cầu sau. Đáng tiếc rằng, hệ thống treo khí nén điện tử chỉ cung cấp dưới dạng tùy chọn. Xe có khả năng lội nước sâu 650 mm. Kích thước lần lượt là dài 4.803 mm, rộng 2.032 mm vào cao 1.665 mm. Trọng lượng 1.829 kg Điểm đáng chú ý của Range Rover Velar là cuộc cách mạng bên trong cabin. Xe loại bỏ hoàn toàn phím bấm vật lý ở bảng điều khiển bằng màn hình hoặc nút bấm cảm ứng, chỉ giữ lại 3 núm xoay ở chính giữa. Hệ thống thông tin giải trí Touch Pro Duo bao gồm 2 màn hình cảm ứng 10 inch có độ phân giải cao. Bên trên điều khiển về giải trí, còn bên dưới điều khiển về chức năng như điều hòa, gió, hay sưởi ghế. Ngay phía dưới còn một hàng nút bấm cảm ứng nhỏ để điều khiển một số chức năng như sưởi kính, cân bằng điện tử hay hỗ trợ đổ dốc. Range Rover Velar - SUV hang sang Anh quoc Nút bấm trên vô-lăng đều được đưa về dạng cảm ứng. Thời điểm Velar vừa ra mắt, nhiều người đặt câu hỏi về tính an toàn của chúng. Bởi nó khiến người lái mất tập trung. Xe trang bị màn hình đồng hồ Full LCD và HUD hiển thị thông tin lên kính lái. ',1,1,5390,'2018-05-16 09:43:44','2018-05-16 09:43:44'),(27,'Xe Cũ Mazda BT-50 3.2 AT 2015','xe-cu-mazda-bt-50-3-2-at-2015',' Salon ô tô Ánh Lý bán xe Mazda BT50 3.2AT sản xuất 2015 đăng ký 2016 dàn lốp theo xe còn nguyên lốp dự phòng chưa đạt đất - số tự động - máy dầu 2 cầu. Xe trang bị gồm: điều khiển tích hợp vô lăng, túi khí an toàn, điều hòa tự động, cảm biến, phanh ABS, đèn bi, giải trí màn hình DVD/MP3/AM/FM, xi nhan gương, kết nối ngoại vi,... cùng nhiều tiện ích khác. *Cam kết với khách hàng bằng văn bản khi mua xe: - Cam kết xe nguyên bản không đâm đụng, ngập nước, máy nguyên bản. - Hỗ trợ mọi thủ tục trả góp lãi suất ưu đãi thủ tục nhanh gọn. ',1,1,595,'2018-05-16 09:43:45','2018-05-16 09:43:45'),(28,'Xe Mới Lexus GX 460 2017','xe-moi-lexus-gx-460-2017',' Kích thước ( D x R x C ) ( mm ) 4.879 x 1.885 x 1.885 Khoảng cách giữa 2 láp (mm) 2.790 Tự trọng(Kg ) 2.326 Khoảng sang gầm xe ( mm) 205 Dung tích xi lanh ( cc ) 4.6L Kiểu động cơ V8 DOHC Dual VVTi Hộp số Tự Động 6 cấp điện tử,chế độ số thể thao Công suất (hp @ vòng / phút) 301 hp @ 5500 rpm Momen xoắn (lb.ft @ vòng / phút) 329 lb.ft @ 3500 rpm Bình nhiên liệu ( l ) 87L Loại nhiên liệu Xăng Kiểu dẫn động 2 cầu(4WD) Số cửa/chỗ ngồi 05/07 Cỡ lốp 265/60 R18 II. TRANG THIẾT BỊ AN TOÀN & TIỆN NGHI • Hệ thống túi khí an toàn: 12 túi khí  • Hệ thống chống bó cứng phanh ABS • Hệ thống phân bổ lực phanh điện tử EBD • Hệ thống hỗ trợ lực phanh khẩn cấp BAS • Hệ thống cân bằng điện tử VSC • Hệ thống chống trơn trượt Traction control • Hệ thống hỗ trợ đỗ đèo HAC • Hệ thống kiểm soát động lực học VDIM • Hệ thống cài đặt thông tin cá nhân LPS • Hệ thống đi ga tay Cruise control • Hệ thống cảm biến áp suất lốp TMPS • Hệ thống khóa Smart key, Start Stop • Vô lăng điều khiển 4 hướng,trợ lực lái EPS • Kính màu chống tia cực tím, 1 chạm chống kẹt • Gương chiếu hậu chống chói ECM • Hàng ghế trước điều khiển 10 hướng,nhớ ghế lái • Hệ thống âm thanh cao cấp 15 loa  • Màn hình DVD trung tâm hiển thị đa chức năng  • Kết nối bluetooth _ AUX,USB, Radio FM-AM • DVD tích hợp tựa đầu hàng ghế trước • Phím điều khiển tích hợp vô lăng • Nội thất da cao cấp • Sấy và thông gió hàng ghế trước • Điều hòa tự động 2 vùng, lọc gió không khí • Đèn pha 3 bi_xenon cảm biến theo góc lái AFC ( đèn liếc ) • Camera lùi, Cảm biến va chạm trước sau • Cảm biến gạt mưa tự động • Cửa nóc điều khiển điện • Lốp dự phòng, kích lốp ',1,1,5500,'2018-05-16 09:43:47','2018-05-16 09:43:47'),(29,'Xe Mới Nissan Navara EL 2017','xe-moi-nissan-navara-el-2017',' Nissan Navara EL  \"Navara EL cho cảm giác tăng tốc và sang số dứt khoát hơn ở các cấp số 1-2-3 khi đi tốc độ thấp so với bản VL. Nếu muốn tăng tốc thật mạnh mẽ, cỗ máy 2.5 này cũng sẵn sàng chiều lòng nếu người lái đạp lút ga và cũng làm người ngồi “dính ghế \" ✔️ Hộp số 7 cấp ( Tăng tốc mượt mà, tiết kiệm nhiên liệu ) ✔️ Hệ thống khung gầm dạng hộp kín (Đã được #Mercedes mua lại bản quyền ) ✔️ Hệ thống treo đa liên kết ( Giúp xe cân bằng tốt, ổn định khi vào cua ) ???Hỗ trợ trả góp từ 80 - 85 % giá trị xe thủ tục nhanh gọn. ✔️ Hỗ trợ các thủ tục đăng ký đăng kiểm ✔️ Giao xe tận nơi ✔️ Tư vấn miễn phí 24/24 ✔️ Hậu mãi trọn đời ',1,1,650,'2018-05-16 09:43:48','2018-05-16 09:43:48'),(30,'Xe Mới Hyundai I10 1.2 AT CKD 2017','xe-moi-hyundai-i10-1-2-at-ckd-2017',' Giá trên đã trừ khuyến mại từ tập đoàn, chưa bao gồm Khuyến mại của đại lý. Khi gọi điện đến HOTLINE cho chúng tôi, vui lòng nhắc tới Choxe.net để nhận được hỗ trợ tốt nhất. ------ Hỗ trợ thủ tục trả góp lên tới 100% (nếu thế chấp tài sản khác) hoặc 90% giá trị chiếc xe (nếu thế chấp chính chiếc xe mua). Lãi suất từ 5.9%/năm, vay tối đa 7 năm.  [GIỚI THIỆU] Hyundai Grand i10 là dòng xe nhỏ bé nhất nhưng lại là dòng xe chiến lược của Hyundai, được đánh giá cao trên thị trường thế giới với nhiều giải thưởng như giải thưởng thiết kế REDDOT 2014, giải thưởng “Xe của năm tại Ấn Độ”, giải thưởng “Chất lượng” của tạp chí AUTOBILD của Đức. Grand i10 được nhập khẩu chính hãng bởi Hyundai Thành Công vào năm 2014. Kể từ đó i10 gây nên cơn sốt cho đến tận bây giờ vẫn chưa có dấu hiệu ngừng lại và hiện đang giữ vị trí dòng xe có doanh số bán nhiều nhất tại VIệt Nam, tạo nên thành công bậc nhất của Hyundai tại thị trường Việt Nam với hơn 50 nghìn xe được bán ra trong ba năm từ 2014 đến 2016. Trước nhu cầu của thị trường cũng như định hướng phát triển ngành công nghiệp ô tô của nhà nước và chính phủ, vào ngày 05/7/2017, Hyundai Thành Công đã quyết định ra mắt phiên bản nâng cấp của Grand i10, với những cải tiến mới thuyết phục hơn, an toàn hơn, nhiều màu sắc hơn và giá rẻ hơn. Chú thích: CKD: Xe lắp ráp dưới dạng CKD (nhập khẩu \"3 cục\")  [NỔI BẬT] GRAND I10 CKD 2017 được nâng cấp 2 điểm khác biệt rất đáng giá: 1. Grand i10 CKD 2017 được trang bị dải đèn LED chạy ban ngày DRL (Daytime Running Light) giúp chiếc xe nổi bật trên phố, thu hút sự chú ý khi xe lăn bánh trên đường. 2. Grand i10 CKD 2017 được bổ sung thêm tính năng phân bổ lực phanh điện tử EBD, kết hợp với hệ thống chống bó cứng phanh ABS giúp cho chiếc xe an toàn hơn mỗi khi sử dụng phanh, không lo phanh thiếu lực hay dư thừa lực phanh, dễ dàng kiểm soát xe mỗi khi xảy ra tình huống bất ngờ.  [NGOẠI THẤT] GRAND I10 1.2 Hatchback CKD 2017 hoàn toàn mới vẫn thừa hưởng thiết kế ngoại thất cá tính và thời trang của ngôn ngữ điêu khắc dòng chảy 2.0 trước đó. Chiếc xe sở hữu kích thước tổng thể dài nhân rộng nhân cao lần lượt là 3765x1660x1505 đối với bản Hatchback 5 cửa, 3995x1660x1505 đối với bản Sedan 4 cửa, cùng với đó là khoảng sáng gầm xe 152mm và chiều dài cơ sở 2425mm đối với cả 2 phiên bản. Các kích cỡ của Grand i10 vượt trội hơn hẳn so với các đối thủ, nội thất rộng rãi bậc nhất đem đến cho khách hàng một chiếc xe đô thị phân khúc A mà trải nghiệm của các dòng xe phân khúc cao hơn. Mẫu xe Grand i10 nâng cấp của năm 2017 được sở hữu đường nét khoẻ khoắn, trẻ trung hơn với cả dưới cùng lưới tản nhiệt cỡ lớn hình lục giác tạo hình thác nước với các nan nhỏ bên trong cũng được tạo hình lục giác giúp tăng cường lượng khí làm mát cho động cơ, gia tăng hiệu suất tối đa, kết hợp với cụm đèn sương mù và dải đèn led chạy ban ngày DRL (Daytime Runing Light) tạo nên phong cách thể thao và ấn tượng ngay từ cái nhìn trực diện. Toàn bộ thân xe được bo tròn phối hợp những đường cắt và đường gân chạy dọc nổi tôn lên tính khí động học và vẻ rộng rãi của xe. Phiên bản Hatchback được trang bị la zăng hợp kim 4 chấu kép 14” dinamon CUT làm tăng thêm tính thể thao. Còn phiên bản Sedan trang bị la zăng hợp kim nhôm 14” với các nan lớn gia tăng vẻ lịch lãm của xe. Gương chiếu hậu của Hyundai GRAND I10 1.2 Hatchback CKD 2017 có thể chỉnh điện, gập điện và được trang bị thêm tính năng sấy gương chưa từng xuất hiện trước đó. Với tính năng mới này, chúng ta sẽ không phải lo lắng khi gương ngoài bị hấp hơi hay đọng hơi nước cản trở tầm quan sát phía sau, gia tăng an toàn và tiện dụng. Ở phía sau, Grand i10 được trang bị cụm đèn hậu cỡ lớn tạo hình vân Led 3D đem đến hiệu quả chiếu sáng đẹp mắt và dễ dàng phát hiện khi phanh ở trong những điều kiện thiếu sáng, gia tăng tính an toàn. Các chi tiết khác thể hiện sự tinh tế trong thiết kế của Grand i10 như tay năm cửa mạ Crom, đèn xi nhan tích hợp trên gương, đèn phanh trên cao dạng LED, ăng ten đuôi chuồn, ốp hông nổi màu đen tạo nên một chiếc xe sở hữu ngoại hình hấp dẫn hàng đầu phân khúc mang phong cách châu âu hiện đại.  [NỘI THẤT] Hyundai GRAND I10 1.2 Hatchback CKD 2017 sở hữu khoang nội thất rộng rãi thoải mái và hiện đại hàng đầu phân khúc nhờ các kích cỡ vượt trội. Phong cách thiết kế nội thất nhấn mạnh đến sự thuận tiện, hợp lý trong việc bố trí các nút chức năng cho người dùng. Hyundai Grand i10 lần đầu tiên ra mắt vào năm 2014 là dòng xe tiên phong trong phân khúc xe hạng A được trang bị tính năng khởi động Start/stops engine một chạm, kết hợp với chìa khoá thông minh Smart Key tiếp tục được kế thừa cho tới phiên bản hiện tại, mang đến tính hiện đại và thuận tiện cho chủ nhân chiếc xe. Bảng trung tâm nổi bật với màn hình cảm ứng 7” đa chức năng, hỗ trợ giải trí với các kết nối thời thượng hiện nay như USB/AUX/Bluetooth, radio… hỗ trợ phát hình đa dạng độ phân giải FullHD cùng với 4 loa chất lượng. Bên cạnh đó Màn hình AVN này được các kỹ sư Hyundai nghiên cứu riêng phần mềm bản đồ dẫn đường chuyên dụng dành riêng cho thị trường Việt Nam, đem đến cho người dùng một ứng dụng chất lượng về thông tin. Nội thất xe được bọc da pha nỉ kết hợp cùng các chi tiết nhựa đen được bố trí hợp lý sử dụng tông màu trẻ trung tạo nên không gian nội thất hiện đại cho chiếc xe. Vô lăng của Grand i10 được bọc da, sử dụng hệ thống trợ lực điện giúp tiết kiệm nhiên liệu, dễ dàng xoay sở trong thành phố đông đúc nhưng vẫn đem đến cảm giác lái chân thật. Trên vô lăng đã được tích hợp các nút điều khiển hệ thống, gia tăng an toàn, tránh việc người lái bị mất tập trung khi cần tương tác với hệ thống. Bên trong Hyundai GRAND I10 1.2 Hatchback CKD 2017 được bố trí nhiều hộc chứa đồ, cùng với hàng ghế sau có thể gập hoàn toàn, giúp cho người dùng tối ưu hoá được không gian ngồi trong xe.  [AN TOÀN] Hyundai GRAND I10 1.2 Hatchback CKD 2017 được trang bị những tính năng an toàn hàng đầu như túi khí đôi, cảm biến lùi hỗ trợ đỗ xe, camera lùi đối với bản sedan, hệ thống chống bó cứng phanh ABS, hệ thống phân bổ lực phanh điện tử EBD. Đặc biệt, grand i10 được trang bị khung xe với vật liệu chịu lực cao giúp hấp thụ tối đa lực tác động khi xảy ra tình huống va chạm, đảm bảo an toàn cho toàn bộ hành khách ngồi trong xe. ',1,1,395,'2018-05-16 09:43:49','2018-05-16 09:43:49'),(31,'Xe Cũ Mercedes-Benz CLC GLC 250 2017','xe-cu-mercedes-benz-clc-glc-250-2017',' ?? GLC250 model 2018 ?Mercedes GLC250 trắng/Nâu  ?Sx 2017  ?Biển Hà nội đẹp ?Mới đi 5.278km quá mới ?Không 1 vết xước, đã phủ ceramic  ?Xe cam kết, không đâm, không ngập, không lỗi, còn bảo hành, check hãng mọi miền tổ quốc.  ?Giá bán: 1.889 tỷ VNĐ ?Ngân hàng hỗ trợ 70% ',1,1,1889,'2018-05-16 09:43:50','2018-05-16 09:43:50'),(32,'Xe Mới Lexus ES 250 2018','xe-moi-lexus-es-250-2018',' Bán Lexus Es250 2018 màu Đen nội thất Đen, xe nhập khẩu nguyên chiếc mới 100% Xe nhập khẩu thương mại chính ngạch, giao xe và giấy tờ hồ sơ đăng ký ngay trong ngày ',1,1,2450,'2018-05-16 09:43:51','2018-05-16 09:43:51'),(33,'Xe Mới Lexus LX LX570 2017','xe-moi-lexus-lx-lx570-2017',' Kính gửi : Quý khách hàng  THÔNG SỐ VÀ TRANG THIẾT BỊ XE LEXUS LX570 2016  I. THÔNG SỐ KỸ THUẬT  Chủng loại Lexus LX570 Xuất xứ USA N