ngày. Xe được giữ gìn nên còn rất đẹp nội thất bọc da sạch sẽ, hệ thống đồ chơi màn hình DVD kết hợp camera lùi, gương kính chỉnh điệ, điều hòa mát sâu, máy nổ rất êm, khô ráo gầm bệ chắc chắn. Vui lòng liên hệ biết thêm chi tiết. ',1,1,195,'2018-05-16 09:44:10','2018-05-16 09:44:10'),(46,'Xe Mới Land Rover Range Rover SV Autobiography 2016','xe-moi-land-rover-range-rover-sv-autobiography-2016',' Land Rover Range Rover SV Autobiography Hybrid 3.0L sản xuất năm 2016, xe nhập khẩu thương mại chính ngạch Land Rover Range Rover SV Autobiography Hybrid được tranh bị khối động cơ diesel SDV6, dung tích 3.0 L, kết hợp cùng động cơ điện, sản sinh công suất tối đa 354 mã lực và mô-men xoắn cực đại 700 Nm, hệ truyền động được điều khiển thông qua hộp số tự động 8 cấp. Mặc dù yếu hơn đàn anh V8 tới hơn 190 mã lực tuy nhiên mẫu xe này vẫn có khả năng tăng tốc 0-100 km/h chỉ trong 6,5 giây trước khi đạt tốc độ tối đa 217 km/h. Land Rover Range Rover SV Autobiography Hybrid được trang bị option full: 04 ghế ngồi massage và chỉnh điện, 02 bàn làm việc, 02 hộp lạnh, âm thanh cao cấp 29 loa Madiran 3D 1700Wat, 03 màn hình, trần da, hắt kính, camera 360, ... ',1,1,11280,'2018-05-16 09:44:11','2018-05-16 09:44:11'),(47,'Xe Mới Hyundai I10 1.2 MT Base CKD 2017','xe-moi-hyundai-i10-1-2-mt-base-ckd-2017',' Giá trên đã trừ khuyến mại của tập đoàn và chưa bao gồm khuyến mại của Đại lý. Khi gọi điện đến HOTLINE cho chúng tôi, vui lòng nhắc tới Choxe.net để nhận được hỗ trợ tốt nhất. ------ Hỗ trợ thủ tục trả góp lên tới 100% (nếu thế chấp tài sản khác) hoặc 90% giá trị chiếc xe (nếu thế chấp chính chiếc xe mua). Lãi suất từ 5.9%/năm, vay tối đa 7 năm. ------ Nếu Quý KH lựa chọn Grand i1.2 MT Sedan base, tức là KH lựa chọn giản lược một số tính năng sau so với bản i10 1.2 MT Sedan (bản đủ): - La-zăng thép ốp nhựa thay vì đúc hợp kim. - Không có đèn sương mù + Đèn led chạy ban ngày. - Gương gập cơ. - Gương không tích hợp đèn báo rẽ. - Tay nắm cửa cùng màu xe (Không mạ Crom). - Không có cảm biến lùi và Camera lùi. - Không có gương hậu trong xe chống chói tự động. - Không có nút khởi động Starts/Stops. - Không có màn hình giải trí. - Vô lăng nhựa và không có nút điều khiển giải trí trên Vô lăng. - Cần số nhựa (không bọc da sang trọng). - Không có túi khí. - Không có phân phối lực phanh điện tử EBD. - Không có chống bó cứng phanh ABS. Với những tính năng được lược giản trên, khách hàng sẽ được sở hữu chiếc xe có giá cách biệt rẻ hơn gần 40 triệu đồng so với bản đủ 1.2 MT Sedan. Phiên bản này phù hợp với những KH có nhu cầu kinh doanh, khi mà những thiết bị trên không cần thiết và đáp ứng được nhu cầu đầu tư đầu vào thấp nhưng vẫn giữ nguyên hiệu quả kinh doanh. Hoặc phù hợp với những gia đình trẻ muốn có một chiếc ô tô che mưa nắng đi lại trong thành phố, sợ mua xe cũ không đảm bảo nhưng hầu bao hạn hẹp. ----- [GIỚI THIỆU] Trước nhu cầu của thị trường cũng như định hướng phát triển ngành công nghiệp ô tô của nhà nước và chính phủ, vào ngày 05/7/2017, Hyundai Thành Công đã quyết định ra mắt phiên bản nâng cấp của Grand i10, với những cải tiến mới thuyết phục hơn, an toàn hơn, nhiều màu sắc hơn và giá rẻ hơn.  GRAND I10 1.2 MT Sedan Base CKD 2017 hoàn toàn mới vẫn thừa hưởng thiết kế ngoại thất cá tính và thời trang của ngôn ngữ điêu khắc dòng chảy 2.0 trước đó. Chiếc xe sở hữu kích thước tổng thể dài nhân rộng nhân cao lần lượt là 3765x1660x1505 đối với bản Hatchback 5 cửa, 3995x1660x1505 đối với bản Sedan 4 cửa, cùng với đó là khoảng sáng gầm xe 152mm và chiều dài cơ sở 2425mm đối với cả 2 phiên bản. Các kích cỡ của Grand i10 vượt trội hơn hẳn so với các đối thủ, nội thất rộng rãi bậc nhất đem đến cho khách hàng một chiếc xe đô thị phân khúc A mà trải nghiệm của các dòng xe phân khúc cao hơn. Mẫu xe Grand i10 nâng cấp của năm 2017 được sở hữu đường nét khoẻ khoắn, trẻ trung hơn với cả dưới cùng lưới tản nhiệt cỡ lớn hình lục giác tạo hình thác nước với các nan nhỏ bên trong cũng được tạo hình lục giác giúp tăng cường lượng khí làm mát cho động cơ, gia tăng hiệu suất tối đa. ',1,1,350,'2018-05-16 09:44:12','2018-05-16 09:44:12'),(48,'Xe Mới Hyundai I10 1.2 MT Sedan CKD 2017','xe-moi-hyundai-i10-1-2-mt-sedan-ckd-2017',' Giá trên đã trừ khuyến mại từ tập đoàn, chưa bao gồm Khuyến mại của đại lý. Khi gọi điện đến HOTLINE cho chúng tôi, vui lòng nhắc tới Choxe.net để nhận được hỗ trợ tốt nhất. ------ Hỗ trợ thủ tục trả góp lên tới 100% (nếu thế chấp tài sản khác) hoặc 90% giá trị chiếc xe (nếu thế chấp chính chiếc xe mua). Lãi suất từ 5.9%/năm, vay tối đa 7 năm.  [GIỚI THIỆU] Trước nhu cầu của thị trường cũng như định hướng phát triển ngành công nghiệp ô tô của nhà nước và chính phủ, vào ngày 05/7/2017, Hyundai Thành Công đã quyết định ra mắt phiên bản nâng cấp của Grand i10, với những cải tiến mới thuyết phục hơn, an toàn hơn, nhiều màu sắc hơn và giá rẻ hơn.  [NỔI BẬT] - Có tận 6 màu sắc cho KH lựa chọn: Trắng, bạc, đỏ, cam, xanh và cát. - Thiết kế thay đổi, bắt mắt hơn, thời trang hơn. - Grand i10 SEDAN CKD 2017 được bổ sung thêm tính năng phân bổ lực phanh điện tử EBD, kết hợp với hệ thống chống bó cứng phanh ABS giúp cho chiếc xe an toàn hơn mỗi khi sử dụng phanh, không lo phanh thiếu lực hay dư thừa lực phanh, dễ dàng kiểm soát xe mỗi khi xảy ra tình huống bất ngờ.  [NGOẠI THẤT] GRAND I10 1.2 MT SEDAN CKD 2017 hoàn toàn mới vẫn thừa hưởng thiết kế ngoại thất cá tính và thời trang của ngôn ngữ điêu khắc dòng chảy 2.0 trước đó. Chiếc xe sở hữu kích thước tổng thể dài nhân rộng nhân cao lần lượt là 3765x1660x1505 đối với bản Hatchback 5 cửa, 3995x1660x1505 đối với bản Sedan 4 cửa, cùng với đó là khoảng sáng gầm xe 152mm và chiều dài cơ sở 2425mm đối với cả 2 phiên bản. Các kích cỡ của Grand i10 vượt trội hơn hẳn so với các đối thủ, nội thất rộng rãi bậc nhất đem đến cho khách hàng một chiếc xe đô thị phân khúc A mà trải nghiệm của các dòng xe phân khúc cao hơn. Mẫu xe Grand i10 nâng cấp của năm 2017 được sở hữu đường nét khoẻ khoắn, trẻ trung hơn với cả dưới cùng lưới tản nhiệt cỡ lớn hình lục giác tạo hình thác nước với các nan nhỏ bên trong cũng được tạo hình lục giác giúp tăng cường lượng khí làm mát cho động cơ, gia tăng hiệu suất tối đa, kết hợp với cụm đèn sương mù và dải đèn led chạy ban ngày DRL (Daytime Runing Light) tạo nên phong cách thể thao và ấn tượng ngay từ cái nhìn trực diện. Toàn bộ thân xe được bo tròn phối hợp những đường cắt và đường gân chạy dọc nổi tôn lên tính khí động học và vẻ rộng rãi của xe. Phiên bản Hatchback được trang bị la zăng hợp kim 4 chấu kép 14” dinamon CUT làm tăng thêm tính thể thao. Còn phiên bản Sedan trang bị la zăng hợp kim nhôm 14” với các nan lớn gia tăng vẻ lịch lãm của xe. Gương chiếu hậu của Hyundai GRAND I10 1.2 MT SEDAN CKD 2017 có thể chỉnh điện, gập điện và được trang bị thêm tính năng sấy gương chưa từng xuất hiện trước đó. Với tính năng mới này, chúng ta sẽ không phải lo lắng khi gương ngoài bị hấp hơi hay đọng hơi nước cản trở tầm quan sát phía sau, gia tăng an toàn và tiện dụng. Ở phía sau, Grand i10 được trang bị cụm đèn hậu cỡ lớn tạo hình vân Led 3D đem đến hiệu quả chiếu sáng đẹp mắt và dễ dàng phát hiện khi phanh ở trong những điều kiện thiếu sáng, gia tăng tính an toàn. Các chi tiết khác thể hiện sự tinh tế trong thiết kế của Grand i10 như tay năm cửa mạ Crom, đèn xi nhan tích hợp trên gương, đèn phanh trên cao dạng LED, ăng ten đuôi chuồn, ốp hông nổi màu đen tạo nên một chiếc xe sở hữu ngoại hình hấp dẫn hàng đầu phân khúc mang phong cách châu âu hiện đại.  [NỘI THẤT] Hyundai GRAND I10 1.2 MT SEDAN CKD 2017 sở hữu khoang nội thất rộng rãi thoải mái và hiện đại hàng đầu phân khúc nhờ các kích cỡ vượt trội. Phong cách thiết kế nội thất nhấn mạnh đến sự thuận tiện, hợp lý trong việc bố trí các nút chức năng cho người dùng. Hyundai Grand i10 lần đầu tiên ra mắt vào năm 2014 là dòng xe tiên phong trong phân khúc xe hạng A được trang bị tính năng khởi động Start/stops engine một chạm, kết hợp với chìa khoá thông minh Smart Key tiếp tục được kế thừa cho tới phiên bản hiện tại, mang đến tính hiện đại và thuận tiện cho chủ nhân chiếc xe. Bảng trung tâm nổi bật với màn hình cảm ứng 7” đa chức năng, hỗ trợ giải trí với các kết nối thời thượng hiện nay như USB/AUX/Bluetooth, radio… hỗ trợ phát hình đa dạng độ phân giải FullHD cùng với 4 loa chất lượng. Bên cạnh đó Màn hình AVN này được các kỹ sư Hyundai nghiên cứu riêng phần mềm bản đồ dẫn đường chuyên dụng dành riêng cho thị trường Việt Nam, đem đến cho người dùng một ứng dụng chất lượng về thông tin. Nội thất xe được bọc da pha nỉ kết hợp cùng các chi tiết nhựa đen được bố trí hợp lý sử dụng tông màu trẻ trung tạo nên không gian nội thất hiện đại cho chiếc xe. Vô lăng của Grand i10 được bọc da, sử dụng hệ thống trợ lực điện giúp tiết kiệm nhiên liệu, dễ dàng xoay sở trong thành phố đông đúc nhưng vẫn đem đến cảm giác lái chân thật. Trên vô lăng đã được tích hợp các nút điều khiển hệ thống, gia tăng an toàn, tránh việc người lái bị mất tập trung khi cần tương tác với hệ thống. Bên trong Hyundai GRAND I10 1.2 MT SEDAN CKD 2017 được bố trí nhiều hộc chứa đồ, cùng với hàng ghế sau có thể gập hoàn toàn, giúp cho người dùng tối ưu hoá được không gian ngồi trong xe.  [AN TOÀN] Hyundai GRAND I10 1.2 MT SEDAN CKD 2017 được trang bị những tính năng an toàn hàng đầu như túi khí đơn, cảm biến lùi hỗ trợ đỗ xe, camera lùi đối với bản sedan, hệ thống chống bó cứng phanh ABS, hệ thống phân bổ lực phanh điện tử EBD. Đặc biệt, grand i10 được trang bị khung xe với vật liệu chịu lực cao giúp hấp thụ tối đa lực tác động khi xảy ra tình huống va chạm, đảm bảo an toàn cho toàn bộ hành khách ngồi trong xe. ',1,1,389,'2018-05-16 09:44:13','2018-05-16 09:44:13'),(49,'Xe Mới Lexus LX 570 Super Sport 2018','xe-moi-lexus-lx-570-super-sport-2018',' Kích thước (D x R x C) (mm) 5.065 x 1.981 x 1910. Khoảng cách giữa 2 láp (mm) 1970. Tự trọng(Kg) 2990. Khoảng sang gầm xe (mm) 2260. Dung tích xi lanh (cc) 5.7L. Kiểu động cơ 5,7L V8 32 van DOHC với Công nghệ van biến thiên thông minh kép. Hộp số Hộp số tự động 8 cấp tích hợp bộ chuyển đổi tự động. Công suất (hp @ vòng /