 chỉnh điện, xi nhan gương, màn hình DVD, điều hòa Auto kết nối USB, AUX, Bluetooth ........ cùng nhiều tiện ích khác + Cam kết xe chất lượng xe không đâm đụng không ngập nước máy nguyên bản. + Hỗ trợ vay vốn ngân hàng, thủ tục nhanh gọn Quý khách liên hệ để biết thông tin chi tiết ! ',1,1,535,'2018-05-16 09:44:28','2018-05-16 09:44:28'),(58,'Xe Mới Hyundai Elantra 2.0 AT 2017','xe-moi-hyundai-elantra-2-0-at-2017',' Giá trên đã trừ khuyến mại từ tập đoàn, chưa bao gồm Khuyến mại đại lý. Khi gọi điện đến HOTLINE cho chúng tôi, vui lòng nhắc tới Choxe.net để nhận được hỗ trợ tốt nhất. ------ Hỗ trợ thủ tục trả góp lên tới 100% (nếu thế chấp tài sản khác) hoặc 90% giá trị chiếc xe (nếu thế chấp chính chiếc xe mua). Lãi suất từ 5.9%/năm, vay tối đa 7 năm. ------ Hyundai Elantra 2.0 AT CKD 2017 vẫn giữ nguyên công nghệ cũng như ngoại/nội thất so với phiên bản 2016 vừa ra mắt tháng 7/2016 trước đó.  Xe Elantra 2017 là thế hệ thứ 6, là một trong những mẫu xe bán chạy nhất của Hyundai toàn cầu;  Đạt danh hiệu Top mẫu xe an toàn nhất 2015 (do Viện an toàn đường bộ - IIHS - Vinh danh); Danh hiệu Xe của năm 2012 khu vực Bắc Mỹ Được đánh giá an toàn 5 sao bởi ANCAP - Tổ chức uy tín của Australia về đánh giá an toàn xe (năm 2016) ------ Với ngôn ngữ \"Điêu khắc dòng chảy 2.0\", thế hệ thứ sáu của Elantra mang nhiều nét tương đồng trong thiết kế gần đây của Hyundai áp dụng cho dòng Genesis, i40 hay Tucson: nội thất rộng rãi hơn, gia tăng cảm giác lái và nhiều tuỳ chọn động cơ khác nhau cho các thị trường. Vẫn là vậy, Hyundai luôn đi đầu trong việc sản xuất ra những chiếc xe \"nịnh mắt\" - những chiếc xe đứng yên mà ngỡ như đang chuyển động. Đó chính là ý nghĩa, mục đích của ngôn ngữ \"Điêu khắc dòng chảy 2.0\" muốn đem lại cho chủ nhân của những chiếc xe mang nhãn hiệu Hyundai. Và tất nhiên, Hyundai Elantra 2017 không nằm ngoài điều đó. Chiếc xe dường như là một đỉnh cao mới, viết nên lịch sử của thời đại \"điêu khắc dòng chảy\" hưng thịnh!  Hyundai Elantra thế hệ sáu giữ nguyên chiều dài cơ sở 2.700 mm nhưng được tăng chiều rộng từ 1.775 mm lên 1.800 mm, chiều dài cũng được kéo thêm thành 4.570 mm (dài hơn 20 mm), chiều cao là 1.440 mm. Thiết kế điêu khắc dòng chảy 2.0 với lưới tản nhiệt hình thang cùng 5 thanh mạ crôm. Cụm đèn hậu sắc xảo với dải đèn LED ban ngày kiểu dáng boomerang, bên trong sử dụng cấu trúc đèn pha gương cầu kết hợp với halogen. Phần hốc hút gió phía dưới cũng được thiết kế theo dạng boomerang chứa cụm đèn sương mù. Những đường gân trên nắp ca-pô cũng như chạy dọc thân xe mang thiết kế giống thế hệ hiện tại. Phía sau cụm đèn hậu với dải đèn LED 3 phần khá bắt mắt.  Nội thất của Hyundai Elantra 2017 mới đơn giản và ít đường nét uốn lượn hơn so với thế hệ trước. Vô-lăng 3 chấu với nhiều nút điều khiển cùng hệ thống bảng đồng hồ công-tơ-mét được làm thẳng, hướng nhìn về phía người lái tốt hơn, màn hình LCD phụ hiển thị nhiều thông tin cần thiết. Phía sau xe được trang bị cửa gió để làm mát cho người ngồi phía sau, một tiện ích rất cần thiết với khí hậu nhiệt đới gió mùa tại Việt Nam.  Hyundai cho biết họ đã thiết kế lại hệ thống treo gia tăng sự thoải mái cho người đi, gia tăng cảm giác lái ổn định và mượt mà hơn, phản ứng tốt hơn với các điều kiện đường xá. Hệ số cản gió cũng được tối ưu nhờ thiết kế khí động học tốt hơn. Cửa kính được làm dày hơn giảm tiếng ồn xâm nhập vào khoang lái. Hyundai khuyến cáo khách hàng không nên bật nhạc quá to trong xe, bởi khả năng cách âm tuyệt vời của Hyundai Elantra 2017 sẽ khiến chủ nhân và các hành khách \"biệt lập\" với bên ngoài.  Tại Việt Nam, Elantra 2017 mới được Hyundai Thành Công phân phối với 2 phiên bản động cơ: Động cơ xăng Nu 2.0L cho công suất tối đa 156 mã lực tại 6.200 vòng/phút cùng Momen xoắn cực đại 196 Nm tại 4.000 vòng/phút; Động cơ xăng Gamma II 1.6L có công suất tối đa 128 mã lực tại 6.300 vòng/phút cùng Momen xoắn cực đại 154,5 Nm tại 4.850 vòng/phút.  Xe có 2 lựa chọn hộp số: Hộp số tự động 6 cấp và hộp số sàn 6 cấp. Khả năng vận hành của Elantra 2017 được tuỳ chọn qua tính năng Drive Mode 3 chế độ lái Eco (tiết kiệm) – Normal (thông thường) – Sport (thể thao).  Elantra 2017 là chiếc xe đầu tiên trong phân khúc được trang bị cảm biến áp suất lốp. Hệ thống sẽ theo dõi liên tục và thông báo tình trạng áp suất trên 4 bánh xe, đồng thời sẽ có những cảnh báo cho người lái khi có sự thay đổi áp suất lốp có thể gây nguy hiểm cho xe khi vận hành.  Hyundai Elantra 2017 được trang bị hệ thống khung vỏ hoàn toàn mới với hơn 51% thành phần thép cường lực AHSS (Advance High Strength Steel), giúp tăng cường sức chịu lực cũng như đảm bảo độ ổn định. Bên cạnh đó, Elantra 2016 còn được trang bị thanh chịu lực kép cho cửa sau, đảm bảo độ an toàn tối đa cho hành khách.  Xe được trang bị các công nghệ và tính năng an toàn hữu ích cho người sử dụng gồm: Hệ thống chống bó cứng phanh ABS, Hệ thống phân bố lực phanh điện tử EBD, Hệ thống hỗ trợ lực phanh khẩn cấp BA, Hệ thống cân bằng điện tử ESC, Hệ thống kiểm soát thân xe VSM, Hệ thống chống trộm Immobilizer, Hệ thống hỗ trợ khởi hành ngang dốc HAC, Hệ thống 8 cảm biến trước và sau, Hệ thống an toàn 6 túi khí... ',1,1,659,'2018-05-16 09:44:29','2018-05-16 09:44:29'),(59,'Xe Mới Lexus GX 460 2016','xe-moi-lexus-gx-460-2016',' I. THÔNG SỐ KỸ THUẬT  Chủng loại Lexus GX460 Xuất xứ USA Nămsx/model 2016 Kích thước ( D x R x C ) ( mm ) 4.879 x 1.885 x 1.885 Khoảng cách giữa 2 láp (mm) 2.790 Tự trọng(Kg ) 2.326 Khoảng sang gầm xe ( mm) 205 Dung tích xi lanh ( cc ) 4.6L Kiểu động cơ V8 DOHC Dual VVTi Hộp số Tự Động 6 cấp điện tử,chế độ số thể thao Công suất (hp @ vòng / phút) 301 hp @ 5500 rpm Momen xoắn (lb.ft @ vòng / phút) 329 lb.ft @ 3500 rpm Bình nhiên liệu ( l ) 87L Loại nhiên liệu Xăng Kiểu dẫn động 2 cầu(4WD) Số cửa/chỗ ngồi 05/07 Cỡ lốp 265/60 R18 ',1,1,5640,'2018-05-16 09:44:31','2018-05-16 09:44:31'),(60,'Xe Mới Audi Q7 3.0 2016','xe-moi-audi-q7-3-0-2016',' Camera 360. - Cảnh báo vượt trên gương, sấy gương. - Đèn pha led, rửa pha. - Làm mát, sưởi ghế. - Lagrang R20 - Cửa sổ trời