), vay tối đa 7 năm, lãi suất từ 5.9%/năm. Để nhận tư vấn cụ thể hơn, liên hệ Hotline .  [GIỚI THIỆU] Kể từ cuối tháng 8/2017, tại Việt Nam, Hyundai Tucson được phân phối dưới dạng CKD (Lắp ráp trong nước) thay vì CBU (nhập khẩu nguyên chiếc) như trước. Xin lưu ý rằng, dây chuyền lắp ráp được Hyundai Thành Công áp dụng là dây chuyền hiện đại nhất hiện nay mà Hyundai Toàn Cầu đang sử dụng. Theo đó, ở công đoạn cuối, từng chiếc xe chuẩn bị xuất xưởng tại Việt Nam đều được truyền dữ liệu trực tiếp sang Hyundai Hàn Quốc, qua kiểm duyệt trước khi được xuất xưởng và phân phối ra thị trường. Do đó, chất lượng của các xe Tucson ở Việt Nam hoàn toàn tương đồng với các thị trường khác của Hyundai. Hyundai Tucson CKD 2017 máy xăng 2.0 có kích thước dài x rộng x cao lần lượt là 4475 x 1850 x 1660 (mm). Chiều dài cơ sở là 2670 mm, khoảng sáng gầm xe 172 mm. Dung tích bình nhiên liệu đạt 62L. Ở phiên bản lắp ráp CKD, Hyundai Tucson được ra mắt thêm 2 tuỳ chọn động cơ mới bên cạnh động cơ xăng Nu 2.0 MPI (155Ps tại 6.200 vòng/phút) như trước: 1. Động cơ dầu R 2.0 CRD-i tiết kiệm (185 Ps tại 4.000 vòng/phút). 2. Động cơ xăng 1.6 T-GDI Turbo mạnh mẽ (177 Ps tại 5.500 vòng/phút).  [TIỆN NGHI] Các trang thiết bị tiện nghi trên Tucson CKD 2017: - Drive mode 3 chế độ (\"Đặc sản của Hyundai\"). - Chìa khoá thông minh (Khởi động Start/stop). - Kính chỉnh điện; kính cửa lái tự động chống kẹt. - Ngăn lạnh phía trước. - Cửa sổ trời toàn cảnh Panorama. - Điều khiển hành trình Cruise Control (trừ bản thường). - Hệ thống chống trộm Immobilizer. - Hệ thống định vị dẫn đường thông minh phát triển riêng cho Việt Nam. - 6 Loa. - Cửa gió hàng ghế sau. - Tấm chẵn khoang hành lý cơ động. - Điều hoà tự động 2 vùng khí hậu độc lập. - Ghế da cao cấp. - Ghế lái chỉnh điện 10 hướng, ghế phụ chỉnh điện 8 hướng (Trừ bản thường). - Ghế sau có khả năng ngả, hoặc gập 6:4.  [AN TOÀN] Các công nghệ an toàn của Tucson CKD 2017 máy xăng 2.0 bao gồm: - Hệ thống chống bó cứng phanh ABS. - Hệ thống hỗ trợ phanh khẩn cấp BA. - Hệ thống phân bổ lực phanh EBD. - Hệ thống kiếm soát lực kéo TCS. - Hệ thống ổn định chống trượt thân xe VSM. - Hệ thống cân bằng điện tử ESC. - Hệ thống hỗ trợ khởi hành ngang dốc HAC. - Hệ thống hỗ trợ xuống dốc DBC. - Phanh tay điện tử EPB. - Khung xe thép cường lực AHSS. - Cốp điện thông minh chống kẹt (Tự động đóng mở). - Giảm xóc hiệu suất cao ASD (Chỉ trang bị trên bản 1.6 Turbo). - 6 túi khí an toàn.  [PHÂN BIỆT] Chỉ duy nhất Tucson CKD 2017 máy xăng 2.0 mới có 2 phiên bản: Thường (tiêu chuẩn) và đặc biệt. Nếu khách hàng lựa chọn bản xăng thường 2.0, tức là khách hàng lựa chọn lược giản một số tính năng sau: - Rửa đèn pha. - Đèn Halogen 1 bóng (Thay vì LED 2 bóng như bản đặc biệt). - Cửa sổ trời toàn cảnh Panorama. - Điều khiển hành trình Cruise Control. - Tấm chắn khoang hành lý. - Ghế phụ chỉnh điện. - Phanh tay điện tử. - Cốp điện thông minh (cốp điện tự động đóng mở). - 2 túi khí thay vì 6 túi khí như bản đặc biệt. ',1,1,828,'2018-05-16 09:45:07','2018-05-16 09:45:07'),(80,'Xe Mới Toyota Highlander LE 2018','xe-moi-toyota-highlander-le-2018',' Kích thước dài, rộng, cao của xe lần lượt 4.853 mm, rộng 1.925 mm, cao 1.730 mm. Trục cơ sở xe dài 2.789 mm.  Highlander LE sử dụng bộ la-zăng hợp kim, 5 chấu kép, kích thước 18 inch. Lốp xe kích thước 245/60R18.  Thiết kế cabin của Highlander 2017 được đánh giá hiện đại và khá bắt mắt. Vô lăng bọc da tích hợp các nút bấm điều khiển và có lẫy thiết lập hệ thống kiểm soát hành trình.  Phiên bản thấp nhất, Highlander LE 2017 trang bị động cơ xăng 4 xi-lanh, 2.7L, DOHC, 16 van, cùng hệ thống VVT-i, công suất 185 mã lực tại 5.800 vòng/phút và mô-men xoắn cực đại 250 Nm tại 4.200 vòng/phút.  xe giao ngay.  BẢO HÀNH 03 NĂM HỖ TRỢ ĐĂNG KÝ,VAY VỐN NGÂN HÀNG LÃI SUẤT THẤP ',1,1,2430,'2018-05-16 09:45:09','2018-05-16 09:45:09'),(81,'Xe Mới Lexus LX 570 Luxury 2018','xe-moi-lexus-lx-570-luxury-2018',' Bán Lexus LX570 xuất Mỹ sản xuất năm 2018 màu Vàng nội thất Kem, xe nhập khẩu nguyên chiếc, mới 100%. Lexus LX570 sản